function cilame_init(){
  this.make_server = (function(){
    if (this.process){
      var http = require("http");
      var url = require("url");
      var fs = require("fs");
      return function(port, callback){
        var server = http.createServer(function (req, res) {
        var { pathname, query } = url.parse(req.url, true);
          callback(pathname, query, res)
        });
        server.listen(port, () => {
          console.log('start server:', port);
        });
      }
    }
  })()
  this._y = Symbol.for('cilame')
  this.v_t = false
  this.v_log = true
  this._bl = function(){
    if(this.v_log){
      console.log(...arguments)
    }
  }
  this.window = cilame()

  this.v_getlist = window[_y].v_getlist
  this.v_requests = {
    'xmllist': window[_y].XMLHttpRequestList,
    'xmlsend': window[_y].XMLHttpRequestListSend,
    'fetcher': window[_y].fetchList,
  }
  this.v_listeners = window[_y].listeners
  this.v_run_mouse = window[_y].v_run_mouse
  this.v_load = window[_y].v_load
  this.v_mouse = window[_y].v_mouse
  this.v_blocktime = window[_y].v_blocktime
  this.v_blockstarttime = window[_y].v_blockstarttime
  this.v_blockrandom = window[_y].v_blockrandom
  this.v_repair_this = window[_y].v_repair_this // fix Function('return this === window')() detect. but the window hook log will fail.
  this.v_run_vm2 = function(jscode){
    delete console.Console
    var runcode = [cilame, cilame_init, 'cilame_init()', 'debugger', jscode].join('\n')
    return new VM({sandbox: {console}}).run(new VMScript(runcode, 'cilame_test_vm2'))
  }
  this.canvas2d = "data:image/png;base64,"
  this.v_runfile_vm2 = function(file){
    var fs = require('fs')
    var jscode = fs.readFileSync(file, {encoding:'utf8'})
    return v_run_vm2(jscode)
  }
  this.v_t = true
  this.v_repair_this()
  location[_y].href = 'https://sso.icve.com.cn/sso/auth?mode=simple&redirect=https%3A%2F%2Fzjy2.icve.com.cn%2Fadmin%2Fpedding&source=15'
  // document[_y].referrer = 'http://newhref'
  // window[_y].init_cookie('key=value; key2=value2')

  // placeholder:
  document[_y].referrer = ""
  window[_y].init_cookie("")

  v_log = false // 是否打开日志
}

cilame_init()


